import data from './sectionInfo.json'

const DisplayTable = () => {
    return (
        <div className="Appasd">
        <ul>
          {data.map(person => {
            return (
            <li>{person.x_max} {person.lastname}</li>
            )
          })}
        </ul>
      </div>  
    );
}

export default DisplayTable
